import React from 'react';
import PropTypes from 'prop-types';
import styles from './Nav.module.css';

class Nav extends React.Component{
    render(){
        return (
            <ul className={styles.hex}>
                <li><a href="#">Lust</a></li>
                <li><a href="#">Gluttony</a></li>
                <li><a href="#">Greed</a></li>
                <li><a href="#">Sloth</a></li>
                <li><a href="#">Wrath</a></li>
                <li><a href="#">Envy</a></li>
                <li><a href="#">Pride</a></li>
            </ul>
        );
    }
}

export default Nav;
